    return sorted(nums, key=lambda x: (digit_sum(x), nums.index(x)))

def compare_one(a, b):
    if type(a) == type(b):
        if a > b:
            return a
        elif b > a:
            return b
        else:
            return None
    elif isinstance(a, (int, float)) and isinstance(b, (int, float)):
        if float(a) > float(b):
            return a
        elif float(b) > float(a):
            return b
        else:
            return None
    elif isinstance(a, str) and isinstance(b, str):
        a = a.replace(",", ".")
        b = b.replace(",", ".")
        if float(a) > float(b):
            return a
        elif float(b) > float(a):
            return b
        else:
            return None
    else:
        return None

def is_nested(string):
    stack = []
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']' and stack and stack[-1] == '[':
            stack.pop()
    return len(stack) < len(string) and len(stack) > 0

def do_algebra(operator, operand):
    expression = str(operand[0])
    for i in range(len(operator)):
        expression += operator[i] + str(operand[i+1])
    return eval(expression)

def x_or_y(n, x, y):
    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True

    return x if is_prime(n) else y

def find_max(words):
    def count_unique_chars(word):
        return len(set(word))

    max_word = ""
    max_unique_chars = 0

    for word in words:
        unique_chars = count_unique_chars(word)
        if unique_chars > max_unique_chars or (unique_chars == max_unique_chars and word < max_word):
            max_word = word
            max_unique_chars = unique_chars

    return max_word

def int_to_mini_roman(number):
    roman_numerals = {
        1: 'i', 4: 'iv', 5: 'v', 9: 'ix', 10: 'x', 40: 'xl', 50: 'l',
        90: 'xc', 100: 'c', 400: 'cd', 500: 'd', 900: 'cm', 1000: 'm'
    }
    result = ''
    for value, numeral in sorted(roman_numerals.items(), reverse=True):
        while number >= value:
            result += numeral
            number -= value
    return result.lower()

def even_odd_count(num):
    num_str = str(abs(num))
    even_count = len([int(digit) for digit in num_str if int(digit) % 2 == 0])
    odd_count = len([int(digit) for digit in num_str if int(digit) % 2 != 0])
    return (even_count, odd_count)

def Strongest_Extension(class_name, extensions):
    def strength(extension):
        return sum(1 for c in extension if c.isupper()) - sum(1 for c in extension if c.islower())

    strongest = max(extensions, key=strength)
    return f"{class_name}.{strongest}"

import hashlib

def string_to_md5(text):
    if not text:
        return None
    return hashlib.md5(text.encode()).hexdigest()

def generate_integers(a, b):
    start = min(a, b)
    end = max(a, b)
    return [i for i in range(start, end+1) if i % 2 == 0]
